    /**
     * Gets the attribute value for the calculated attribute VouDispIdTrans.
     * @return the VouDispIdTrans
     */
    public String getVouDispIdTrans() {
        if (getCogsVouId() != null && getAttributeInternal(VOUDISPIDTRANS) == null) {
            RowSet dtlsVO1 = getLovVouDtlsVO1();
            dtlsVO1.setNamedWhereClauseParam("CldIdBind", getCldId());
            dtlsVO1.setNamedWhereClauseParam("SlocIdBind", getSlocId());
            dtlsVO1.setNamedWhereClauseParam("OrgIdBind", getOrgId());
            dtlsVO1.setNamedWhereClauseParam("SlsVouDocIdBind", getCogsVouId());
            dtlsVO1.executeQuery();
            Row[] allRowsInRange = dtlsVO1.getAllRowsInRange();
            if (allRowsInRange.length > 0) {
                Row r = allRowsInRange[0];
                Object dispO = r.getAttribute("DocTxnIdDisp");
                Object dtO = r.getAttribute("DocTxnDateDisp");
                if (dispO != null && dtO != null) {
                    setVouDispIdTrans(dispO.toString());
                    setVouDtTrans((Timestamp) dtO);
                }

            }
        } 
        return (String) getAttributeInternal(VOUDISPIDTRANS);
    }

